@amirshim:<p>Yes, range comprehensions were recently optimized to remove direction-checking when possible. On CoffeeScript master ...<p><pre><code>    x for x in [-10..10]
</code></pre>
... compiles into:<p><pre><code>    var x;
    for (x = -10; x <= 10; x++) {
      x;
    }
</code></pre>
Even if the start/end values are variables, the check can be avoided by specifying the step as a number. It'll go out with the next release.
